import "./Navbar.scss";
import { useState } from "react";

function Navbar() {
  const [isActive, setActive] = useState("false");

  const toggleNavbar = () => {
    setActive(!isActive);
  };
  return (
    <div>
      <nav class="navbar">
        <div class="brand-title"></div>
        <a href="#" class="toggle-button" onClick={toggleNavbar}>
          <span class="bar"></span>
          <span class="bar"></span>
          <span class="bar"></span>
        </a>
        <div className={isActive ? "active navbar-links" : "navbar-links"}>
          <ul>
            <li>
              <a href="#">About</a>
            </li>
            <li>
              <a href="#">Experience</a>
            </li>
            <li>
              <a href="#">Projects</a>
            </li>
          </ul>
        </div>
      </nav>
    </div>
  );
}

export default Navbar;
